import React from "react";
import { NavLink } from "react-router-dom";
import "./ComponentSearch.css";
import { Table } from "antd";
import TableContainer from "./ContainerTable";
import { useState } from "react";
import { useEffect } from "react";

export default function ComponentSearch() {
  const [studentData, setStudentData] = useState([]);

  const showData = [
    { title: "STT" },
    { title: "Trường Tiểu học" },
    { title: "Quận/Huyện" },
    { title: "Mã học sinh" },
    { title: "Lớp" },
    { title: "Họ và tên" },
    { title: "Giới" },
    { title: "Nơi sinh" },
    { title: "Dân tộc" },
    { title: "Hộ khẩu" },
    { title: "Điện thoại" },
    { title: "Ghi chú" },
    {
      title: "Ngày sinh",
      children: [
        {
          title: "Ngày",
        },
        {
          title: "Tháng",
        },
        {
          title: "Năm",
        },
      ],
    },
    {
      title: "Điểm sơ tuyển vòng 1 ( Tổng )",
      children: [
        {
          title: "Lớp 1",
        },
        {
          title: "Lớp 2",
        },
        {
          title: "Lớp 3",
        },
        {
          title: "Lớp 4",
        },
        {
          title: "Lớp 5",
        },
        {
          title: "Điểm ưu tiên",
        },
        {
          title: "Tổng điểm",
        },
      ],
    },
  ];

  // const showData = [
  //   "STT",
  //   "Trường Tiểu học",
  //   "Quận/Huyện",
  //   "Mã học sinh",
  //   "Lớp",
  //   "Họ và tên",
  //   "Giới tính",
  //   "Nơi sinh",
  //   "Dân tộc",
  //   "Hộ khẩu thường trú",
  //   "Điện thoại liên hệ",
  //   "Ghi chú",
  //   "Ngày sinh",
  //   "Tháng sinh",
  //   "Năm sinh",
  //   "Tổng điểm năm lớp 1",
  //   "Tổng điểm năm lớp 2",
  //   "Tổng điểm năm lớp 3",
  //   "Tổng điểm năm lớp 4",
  //   "Tổng điểm năm lớp 5",
  //   "Tổng điểm kết quả 5 năm",
  //   "Điểm ưu tiên",
  //   "Tổng điểm sơ tuyển",
  // ];
  useEffect(() => {
    const resultDataShow = {
      method: "GET",
      headers: { "Content-Type": "application/json" },
    };
    fetch("http://localhost:9000/datastudent", resultDataShow)
      .then((response) => {
        return response.json();
      })
      .then((data) => {
        const fixData = (obj) => {
          delete obj["id"];
          for (let key in obj) {
            if (typeof obj[key] === "object") {
              for (let childKey in obj[key]) {
                obj[childKey] = obj[key][childKey];
              }
              delete obj[key];
            }
          }
        };
        data.map((student) => fixData(student));
        setStudentData([...data]);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);

  return (
    <>
      <div className="form-import-container">
        <div className="form-import-content">
          <div className="form-import">
            <div className="title-content">
              <div className="title">
                <h2>THÊM THÔNG TIN SINH VIÊN</h2>
              </div>
              <div className="body-text">
                <div className="body-text-router">
                  <NavLink
                    className="effect-hover"
                    to="/"
                    style={{ color: "#fff" }}
                  >
                    Thêm thông tin
                  </NavLink>
                  <NavLink
                    className="active-router effect-hover"
                    to="/FormSearch"
                    style={{ color: "#fff" }}
                  >
                    Tra cứu thông tin
                  </NavLink>
                </div>
                <div className="body-text-input">
                  <p style={{ marginTop: "35px" }}>
                    Chú ý: dấu (*) là bắt buộc nhập
                  </p>
                  <div className="input-info">
                    <span>(*)</span>
                    <input
                      className=""
                      placeholder="Nhập họ và tên học sinh (VD: Nguyễn Văn Minh)"
                      data-val-required="Yêu cầu nhập họ tên học sinh."
                    ></input>
                  </div>
                  <div className="input-info">
                    <span>(*)</span>
                    <input
                      className=""
                      placeholder="Nhập mã học sinh (VD: 01176GHAK)"
                      data-val-required="Yêu cầu nhập mã học sinh"
                    ></input>
                  </div>
                </div>
              </div>
            </div>
            <div className="body-content">
              <div className="mb-3">
                {/* <input
                  className="form-control"
                  type="file"
                  id="formFile"
                  onChange={(e) => {
                    setSeclectFie(e.target.files[0]);
                  }}
                /> */}
              </div>

              {/* <input
                type="file"
                onChange={(e) => {
                  setSeclectFie(e.target.files[0]);
                }}
              ></input> */}
              <button className="sumit-form-import">Tìm kiếm</button>
            </div>
          </div>
        </div>
      </div>
      <div className="main">
        <div className="showData-list">
          <ul className="list-name-header-container">
            {showData.map((item, index) => {
              if (item.children) {
                console.log("child");
                const arrTag = item.children.map((childrenItem, index) => {
                  console.log(childrenItem);
                  return (
                    <li className="list-name-header show-content" key={index}>
                      {childrenItem.title || "He"}
                    </li>
                  );
                });
                console.log(arrTag.join());
                return arrTag.join();
              } else {
                return (
                  <li className="list-name-header show-content" key={index}>
                    {item.title}
                  </li>
                );
              }
            })}
          </ul>
          {/* {studentData.map((dataShowColum, index) => {
            return (
              <ul className="show-Data" key={index}>
                {Object.keys(dataShowColum).map((key, index) => (
                  <li className="data-sudent show-content" key={index}>
                    <p key={index}> {dataShowColum[key]}</p>
                  </li>
                ))}
              </ul>
            );
          })} */}
        </div>
      </div>
    </>
  );
}
